**Describe the bug**
I found the issue while trying to run ONNX graph with multiple output nodes on a single core CPU. I configured the session inter and intra op threads count to 1, however I am seeing 12 threads spawned by the process.

I did not find any issue with ONNX graph with single output node scenario.


**System information**
- OS Platform and Distribution  : **OS X 10.13.6**
- ONNX Runtime installed from (source or binary):   **onnxruntime/commit/d4106deeb65c21eed3ed40df149efefeb72fe9a4**
- ONNX Runtime version: **1.8, onnxruntime-osx-x64-1.8.0**
- CPU: Intel

**To Reproduce**
- Attached test ONNX graph to reproduce the behavior [test.onnx.zip](https://github.com/microsoft/onnxruntime/files/7422966/test.onnx.zip)

**Expected behavior**
- ONNX graph execution should be using single CPU core

```cpp
int main() {

   const std::string mdl_name = "test.onnx";
   Ort::Env m_env(OrtLoggingLevel::ORT_LOGGING_LEVEL_WARNING, "ONNX_TEST");

   Ort::SessionOptions m_options;
   m_options.SetInterOpNumThreads(1);
   m_options.SetIntraOpNumThreads(1);
   m_options.SetExecutionMode(ORT_SEQUENTIAL);
   m_options.SetGraphOptimizationLevel(GraphOptimizationLevel::ORT_ENABLE_ALL);

   Ort::Session m_session(m_env, mdl_name.c_str(), m_options);
   Ort::AllocatorWithDefaultOptions allocator;

   
   size_t inputTensorSize = 10 * 3 * 32 * 32;
   std::vector<int64_t> inputNodeDims = {10, 3, 32, 32};
   std::vector<const char*> inputNodeNames = {"input.1"};
   std::vector<const char*> outputNodeNames = {"o1", "o2", "o3", "o4"};
   std::vector<float> vec(inputTensorSize);

   auto memory_info = Ort::MemoryInfo::CreateCpu(OrtAllocatorType::OrtArenaAllocator, OrtMemType::OrtMemTypeDefault);
   Ort::Value input_tensor = Ort::Value::CreateTensor<float>(memory_info, vec.data(), 
                                                             inputTensorSize, inputNodeDims.data(), inputNodeDims.size());

   std::vector<Ort::Value> outputTensors;
   for(auto idx = 0; idx < 1000; idx++) {
        outputTensors = m_session.Run(Ort::RunOptions{nullptr}, inputNodeNames.data(),
                                      &input_tensor, inputNodeNames.size(), 
                                      outputNodeNames.data(), outputNodeNames.size());
   }
}

``
[test.onnx](https://github.com/microsoft/onnxruntime/files/7422966/test.onnx.zip)
